using System;
using System.Collections.Specialized;

namespace SimpleAuthentication.Core.Providers
{
    public class FakeProvider : BaseProvider, IFakeAuthenticationProvider
    {
        public FakeProvider(string name) : base(name, "Fake/Custom")
        {
            // Defaults.
            AccessToken = new AccessToken
                          {
                              PublicToken = "EstSularusOthMithas-MyHonorIsMyLife",
                              ExpiresOn = DateTime.UtcNow.AddDays(30),
                          };

            UserInformation = UserInformation ?? new UserInformation
                                                 {
                                                     Gender = GenderType.Male,
                                                     Id = "FakeId-ABCDEFGHIJKLMNOPQRSTUVWXYZ",
                                                     Locale = "en-au",
                                                     Name = "Sturm Brightblade",
                                                     Picture =
                                                         "data:image/jpeg;base64,",
                                                     UserName = "Sturm.Brightblade"
                                                 };
        }

        #region BaseToken Implementation

        public override RedirectToAuthenticateSettings RedirectToAuthenticate(Uri callbackUri)
        {
            if (callbackUri == null ||
                string.IsNullOrEmpty(callbackUri.AbsoluteUri))
            {
                throw new ArgumentNullException("callbackUri");
            }

            var state = Guid.NewGuid().ToString();
            var redirectUri = string.Format("{0}{1}", callbackUri.AbsoluteUri, GetQuerystringState(state));

            return new RedirectToAuthenticateSettings
                   {
                       RedirectUri = new Uri(redirectUri),
                       State = state
                   };
        }

        public override IAuthenticatedClient AuthenticateClient(NameValueCollection queryStringParameters,
                                                                string state,
                                                                Uri callbackUri)
        {
            if (queryStringParameters == null)
            {
                throw new ArgumentNullException("queryStringParameters");
            }

            if (string.IsNullOrEmpty(state))
            {
                throw new ArgumentNullException("state");
            }

            if (callbackUri == null)
            {
                throw new ArgumentNullException("callbackUri");
            }

            return new AuthenticatedClient(Name)
                   {
                       AccessToken = AccessToken,
                       UserInformation = UserInformation
                   };
        }

        #endregion

        #region IFakeAuthentication Implementation

        public string RedirectToAuthenticateExceptionMessage { protected get; set; }
        public UserInformation UserInformation { protected get; set; }
        public string AuthenticateClientExceptionMessage { protected get; set; }

        #endregion
    }
}